// DEP.
import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';

// CSS
import '../css/App.css'
import '../css/Resume.css'
import WOW from 'wowjs';

export default class Footer extends Component {

    state = {

        active: false

    }

    componentDidMount() {

        new WOW.WOW().init();

    };

    render() {

        return (

            <footer>

                <div className='Pages'>

                    {window.location.href.split('/')[3] === '' ?

                        <>
                            <NavLink exact to='/Interests'>Interests</NavLink>
                            <NavLink exact to='/Resume'>Resume</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : window.location.href.split('/')[3] === 'Interests' ?

                        <>
                            <NavLink exact to='/'>Skills</NavLink>
                            <NavLink exact to='/Resume'>Resume</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : window.location.href.split('/')[3] === 'Resume' ?

                        <>
                            <NavLink exact to='/'>Skills</NavLink>
                            <NavLink exact to='/Interests'>Interests</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : null }

                    <div className = 'CMFooter'>
                        <p>Contact Me</p>
                        <ul>
                            <p>Email</p>
                            <p>LinkedIn</p>
                            <p>GitHub</p>
                        </ul>
                    </div>

                </div>

            </footer>

        )
    }
}
